class App extends React.Component {
  render() {
    return (
      <div>
        <div>
          <form className="ui input focus">
            <label>Income</label>
            <input type="text" />
          </form>
        </div>
        <div>
          <form>
            <label>Expenses</label>
            <input type="text" />
          </form>
        </div>
      </div>
    );
  }
}

export default App;
